Journey Into Mystery #-1 (Flashback) (1997) (X-Future-OCD) (re-ed) 


In July 1997, Marvel Comics released #-1 issues of most of its comic volumes in an event dubbed Flashback Month. These issues were meant to showcase untold tales from their characters origins. Titles involved in Hero's Reborn did not participate in the Flashback Month.
